import { React, useState, useEffect } from 'react';





function Header() {


    return(

        <nav class="navbar navbar-default">
        <div class="container-fluid">
          <div class="navbar-header">
            <a class="navbar-brand" href="#">WebSiteName</a>
          </div>
        </div>
      </nav>

    );
}



export default Header;
